import React from "react";
import {
  Box,
  Heading,
  VStack,
  Text,
  useColorModeValue,
  Divider
} from "@chakra-ui/react";

export default function HistoryPage() {
  // Exemple de fausses données
  const history = [
    { id: 1, date: "2025-08-01", event: "Consultation de la heatmap" },
    { id: 2, date: "2025-08-05", event: "Mise à jour du profil" },
    { id: 3, date: "2025-08-10", event: "Ajout d’une nouvelle zone" },
  ];

  return (
    <Box
      minH="100vh"
      bg={useColorModeValue("principal.50", "gray.800")}
      py={10}
      px={4}
      display="flex"
      justifyContent="center"
    >
      <VStack
        spacing={6}
        p={8}
        bg={useColorModeValue("white", "gray.700")}
        boxShadow="xl"
        borderRadius="2xl"
        w="100%"
        maxW="600px"
        align="stretch"
      >
        <Heading
          as="h1"
          fontSize="2xl"
          fontFamily="heading"
          color={useColorModeValue("gray.900", "white")}
        >
          Historique des actions
        </Heading>

        {history.map((item, idx) => (
          <Box key={item.id}>
            <Text fontWeight="bold" color={useColorModeValue("gray.700", "gray.200")}>
              {item.date}
            </Text>
            <Text color={useColorModeValue("gray.600", "gray.300")}>
              {item.event}
            </Text>
            {idx < history.length - 1 && <Divider my={4} />}
          </Box>
        ))}
      </VStack>
    </Box>
  );
}
